import nest
from nest import topology as ntop
import time
import logging
log = logging.getLogger(__name__)

def ConnectLayers(p1, p2, **kwargs):
    start = time.time()
    ntop.ConnectLayers(p1, p2, **kwargs)
    log.info("%5.1f sec for connecting layer: %s", time.time()-start, kwargs)

def Connect(p1, p2, **kwargs):
    start = time.time()
    if 'model' in kwargs['syn_spec']:
        del kwargs['syn_spec']['model']
    nest.Connect(p1, p2, **kwargs)
    log.info("%5.1f sec for connecting populations: %s", time.time()-start, kwargs)

